import character1 from '../assets/images/character1.jpg';

function ProfileImage(image = character1, points, username ) {

  return (
    <div className="profile-image-container">
      {image && <img src={image} alt="Profile" className="profile-image-container__image" />}
      <p className="profile-image-container__points">{points}pts</p>
    </div>
  );
}

export default ProfileImage;
